import styles from '../pages_css/Home.css';
import Navbar from '../compenents/Navbar.js';
import Footer from '../compenents/Footer.js';
import Carousel from '../compenents/Carousel';

import Products from '../compenents/products';
import contents1 from '../data/content';
import brand_nav from '../data/brand_nav';

import { Link } from 'react-router-dom';
import React, { useContext } from 'react';
import { TranslateContext } from '../data/TranslateProvider'; 


const Home = () => {

  const { translateText } = useContext(TranslateContext);


  return (
    <div className="home">
      <div className="home">
        <Navbar />

        <div className="quick_click_3">
          <div className="container">
            <Link to="/sneakers" className="navbar-link Sneakersq-link">
              <div className="text-q">{translateText('Sneakers')}</div>
            </Link>

            <a href="/shoes" className="navbar-link Shoesq-link">
              <div className="text-q">{translateText('Shoes')}</div>
            </a>

            <a href="#popular_brands-3" className="navbar-link Popularq-link">
              <div className="text-q">{translateText('Popular brand')}</div>
            </a>
          </div>
        </div>

        <Carousel />

        <div className="home-3">
          <div className="vectors-wrapper-3"></div>
          <div className="text-h">{translateText('Recommended For You')}</div>
          <div className="recommended-3">
            {contents1.slice(0, 3).map((content) => (
              <Products
                key={content.id}
                image={content.image}
                name={content.name}
                price={content.price}
              />
            ))}
          </div>
          <div className="text-h">{translateText('Trending Sneakers')}</div>
          <div className="trending_sneakers-3">
            {contents1.slice(3, 6).map((content) => (
              <Products
                key={content.id}
                image={content.image}
                name={content.name}
                price={content.price}
              />
            ))}
          </div>
          <div className="text-h">{translateText('Popular Brands')}</div>
          <div id="popular_brands-3" className="popular_brands-3">
            {brand_nav.map((product) => (
              <Link to={`/sneakers/${product.id}`} key={product.id}>
                <img src={product.image} alt={product.productType} />
              </Link>
            ))}
          </div>
        </div>

        <Footer />
      </div>




      <Footer />










    </div>
  );
};

export default Home;
